script: |
  super -f text -I q968.spq > q968.out

inputs:
  - name: q968.spq
    data: |
      SELECT d
      FROM t1 (FORMAT parquet)
      WHERE e+d BETWEEN a+b-10 AND c+130
      OR (e>a AND e<b)
      ORDER BY 1;
  - name: t1

outputs:
  - name: q968.out
    data: |
      101
      108
      114
      116
      122
      128
      190
      222
      248
